INSERT INTO `artist` VALUES (5, 'Jonathan G. Ferrar II', 20, 'The Artist to Watch in 2012 by the London Review, Johnathan has already sold one of the highest priced-commissions paid to an art student, ever on record. The piece, entitled Gratitude Resort, a work in oil and mixed media, was sold for $750,000 and Jonathan donated all the proceeds to Art for Peace, an organization that provides college art scholarships for creative children in developing nations', b'1');
INSERT INTO `artist` VALUES (7, 'Hillary Hewitt Goldwynn-Post', 4, 'Hillary is a sophomore art sculpture student at New York University, and has already won all the major international prizes for new sculptors, including the Divinity Circle, the International Sculptor\'s Medal, and the Academy of Paris Award. Hillary\'s CAC exhibit features 25 abstract watercolor paintings that contain only water images including waves, deep sea, and river.', b'1');
INSERT INTO `artist` VALUES (8, 'Hassum Harrod', 60, 'The Art College in New Dehli has sponsored Hassum on scholarship for his entire undergraduate career at the university, seeing great promise in his contemporary paintings of landscapes - that use equal parts muted and vibrant tones, and are almost a contradiction in art. Hassum will be speaking on \"The use and absence of color in modern art\" during Thursday\'s agenda.', b'1');
INSERT INTO `artist` VALUES (10, 'Jennifer Jerome', 36, 'A native of New Orleans, much of Jennifer\'s work has centered around abstract images that depict flooding and rebuilding, having grown up as a teenager in the post-flood years. Despite the sadness of devastation and lives lost, Jennifer\'s work also depicts the hope and togetherness of a community that has persevered. Jennifer\'s exhibit will be discussed during Tuesday\'s Water in Art theme.', b'1');
